import { Close } from "@mui/icons-material";
import {
  Button,
} from "@mui/material";
import '../App.css'

import React, { useEffect, useState } from "react";

const Codedet = () => {
  const [result, setResult] = useState("");
  const [isClosed, setIsClosed] = useState(false);

  useEffect(() => {
    const fetchBooks = async () => {
      try {
        const response = await fetch(`/codes/${global.values.code}/details`);
        if (response.ok) {
          const data = await response.json();
          setResult(data);
        } else {
          console.error("Failed to fetch data");
        }
      } catch (error) {
        console.error("Error:", error);
      }
    };
    fetchBooks();
  }, [global.values.code]);

  const handleClose = () => {
    setIsClosed(true);
    window.location.reload();
  };

  console.log("our result is", result);
  return (
    <div className="division">
      {!isClosed && (
        <div >
          <div>
            <Button
              disableFocusRipple
              disableRipple

              sx={{

                border: "0.5px solid green",
                textAlign: "center",
                height: "20px",
                width: "80px",
                backgroundColor: "#ADD8E6",
                marginLeft: "125px"


              }}
            >
              {global.values.code}
              <Close
                sx={{
                  width: "20px",
                  ml: "5px",
                  color: "#4169E1",

                }}
                onClick={handleClose}
              />
            </Button>
          </div>
          <table>
            <thead>
              <tr></tr>
            </thead>
            <tbody>
              {result && (
                <tr key={result.code}>
                  <td>{result.code}</td>
                  <td>{result.longDescription}</td>
                  <td>
                    {result.billable === true ? (
                      <Button
                        variant="contained"
                        sx={{
                          width: "150px",
                          height: "15px",
                          color: "white",
                          fontFamily: "sans-serif",
                          ml: "20px",
                          backgroundColor: "green",
                          textTransform: "lowercase",
                          fontWeight: "700px",
                          textAlign: "center",
                          "&:hover": {
                            backgroundColor: "green",
                          },
                        }}
                      >
                        Billable Codes
                      </Button>
                    ) : (
                      <Button
                        variant="contained"
                        disableElevation
                        disableFocusRipple
                        sx={{
                          width: "150px",
                          height: "15px",
                          color: "white",
                          fontFamily: "sans-serif",
                          ml: "170px",
                          backgroundColor: "orange",
                          textTransform: "lowercase",
                          fontWeight: "700px",
                          textAlign: "center",
                          "&:hover": {
                            backgroundColor: "orange",
                          },
                        }}
                      >
                        NonBillable Codes
                      </Button>
                    )}
                  </td>
                </tr>
              )}
            </tbody>
          </table>
        </div>
      )}
    </div>
  );
};

export default Codedet;
